`,u.jsx(n.h2,{children:"Introduction"}),`
`,u.jsx(n.p,{children:"This project started as an unfinished idea from NUS Hack&Roll 2025. My team and I had conceptualized a real-time version of the Stress Card Game, but we ran out of time before we could make it fully playable."}),`
`,u.jsx(n.p,{children:"A year later, I felt much more confident in my backend and system design skills. I wanted to revisit the idea - not just to complete it, but to build it properly."}),`
`,u.jsx(n.p,{children:"The Stress Card Game is a popular 1v1 game in Singapore. What makes it exciting is the constant tension - one mistake and your opponent can set you back instantly. Translating that stress element into an online multiplayer environment became the core challenge of this project."}),`
`,u.jsx(n.hr,{}),`
`,u.jsx(n.h2,{children:"Intuition"}),`
