`,u.jsxs(n.li,{children:[`
`,u.jsx(n.p,{children:"A 1v1 game requires reliable matchmaking and deterministic room handling."}),`
`]}),`
`,u.jsxs(n.li,{children:[`
`,u.jsx(n.p,{children:"Real-time synchronization is essential to preserve the stress mechanic."}),`
`]}),`
`,u.jsxs(n.li,{children:[`
`,u.jsx(n.p,{children:"Player identity, room codes, and game sessions must be uniquely generated and tracked."}),`
`]}),`
`,u.jsxs(n.li,{children:[`
`,u.jsx(n.p,{children:"The server must act as the source of truth to prevent state desynchronization."}),`
`]}),`
`,u.jsxs(n.li,{children:[`
`,u.jsx(n.p,{children:"Animations and drag-and-drop interactions must feel responsive despite network latency."}),`
`]}),`
`]}),`
`,u.jsx(n.hr,{}),`
`,u.jsx(n.h2,{children:"Process"}),`
`,u.jsx(n.p,{children:"I started with matchmaking. Surprisingly, the initial implementation was simpler than I expected. I maintained a server-side queue (an in-memory array) that pairs players as they connect. Once two players are available, a game session is instantiated and both clients are assigned to the same room."}),`
`,u.jsx(n.p,{children:"For private matches, I implemented room codes that are automatically generated when a player wants to invite a friend. I used nanoId to generate unique playerId, gameId, and room codes. This kept identifiers short, collision-resistant, and easy to handle across the client and server."}),`
`,u.jsx(n.p,{children:"For real-time communication, I used WebSockets. Instead of pushing for full real-time optimization immediately, I intentionally simplified it to near-real-time updates at 20 FPS. This allowed me to focus on getting the core game logic correct - handling card state, validating moves, resolving conflicts - before worrying about micro-optimizations. The server acts as the authoritative source of truth, and clients simply render the updated state."}),`
`,u.jsx(n.p,{children:"On the frontend, I used React to handle UI state and drag-and-drop mechanics for card interactions. Ensuring that animations felt smooth while remaining consistent with server updates required careful separation between visual state and game state."}),`
`,u.jsx(n.p,{children:"The entire backend and supporting services were deployed on AWS. Hosting the WebSocket server and managing infrastructure in the cloud gave me hands-on experience with deployment pipelines and production environment configuration."}),`
`,u.jsx(n.hr,{}),`
