`,u.jsx(n.p,{children:"The next step is improving UI polish and responsiveness. The core game works, but the experience can feel sharper - better animations, clearer feedback, and improved mobile responsiveness would elevate the gameplay significantly."}),`
`,u.jsx(n.p,{children:"I also want to improve matchmaking reliability and scalability. Moving from in-memory queues to a more persistent or distributed approach would make the system more production-ready. Performance tuning beyond the current 20 FPS update cycle is another area Id like to explore once the infrastructure becomes more robust."})]})}function oA(i={}){const{wrapper:n}=i.components||{};return n?u.jsx(n,{...i,children:u.jsx(xy,{...i})}):xy(i)}function by(i){const n={h2:"h2",hr:"hr",li:"li",p:"p",strong:"strong",ul:"ul",...i.components};return u.jsxs(u.Fragment,{children:[u.jsx(n.hr,{}),`
`,u.jsx(n.h2,{children:"Introduction"}),`
`,u.jsx(n.p,{children:"This project started as a simple experiment to learn web scraping. I just wanted to pull some movie data and understand how scraping pipelines worked end-to-end."}),`
`,u.jsx(n.p,{children:"But as I was building it, I realized the data itself was actually interesting. Instead of stopping at a CSV file, I decided to turn it into something visual  a dashboard that shows where the top 100 most popular movies on IMDb were filmed. Ive always thought 3D globe visualizations on the web looked cool, so this felt like the perfect excuse to finally use one."}),`
`,u.jsx(n.p,{children:"The result is a full-stack application that scrapes IMDb every 6 hours via an automated ETL pipeline and visualizes filming locations on an interactive globe."}),`
`,u.jsx(n.hr,{}),`
`,u.jsx(n.h2,{children:"Intuition"}),`
`,u.jsxs(n.ul,{children:[`
`,u.jsxs(n.li,{children:[`
`,u.jsx(n.p,{children:"Dynamic websites require handling client-side JavaScript rendering."}),`
`]}),`
`,u.jsxs(n.li,{children:[`
`,u.jsx(n.p,{children:"A recurring ETL pipeline needs scheduling, logging, and failure recovery."}),`
`]}),`
`,u.jsxs(n.li,{children:[`
`,u.jsx(n.p,{children:"Data should be normalized and stored before visualization."}),`
`]}),`
`,u.jsxs(n.li,{children:[`
`,u.jsx(n.p,{children:"The backend must expose clean APIs for the frontend."}),`
`]}),`
`,u.jsxs(n.li,{children:[`
`,u.jsx(n.p,{children:"Deployment must support background jobs and container orchestration."}),`
`]}),`
`,u.jsxs(n.li,{children:[`
`,u.jsx(n.p,{children:"Separation of concerns: scraper, API server, and database should be isolated."}),`
`]}),`
`]}),`
`,u.jsx(n.hr,{}),`
`,u.jsx(n.h2,{children:"Process"}),`
`,u.jsxs(n.p,{children:["I initially started with ",u.jsx(n.strong,{children:"BeautifulSoup"}),", assuming simple HTML parsing would be enough. That assumption quickly failed. IMDb pages rely heavily on dynamic JavaScript rendering, and some endpoints are protected against basic bots. Static scraping wasnt reliable."]}),`
`,u.jsxs(n.p,{children:["I pivoted to ",u.jsx(n.strong,{children:"Selenium"}),", which allowed me to render JavaScript and interact with pages more realistically. Since IMDb is commonly used for beginner scraping projects, it was a good controlled environment to experiment with. I followed the sites robots.txt and added a disclaimer clarifying that the data would not be used commercially or with ill intent."]}),`
`,u.jsxs(n.p,{children:["The scraping pipeline is written in ",u.jsx(n.strong,{children:"Python"})," using ",u.jsx(n.strong,{children:"FastAPI"})," for the backend API layer. I used APScheduler to run a cron job every 6 hours to keep the top 100 list current. The data is processed, cleaned, and stored before being exposed to the frontend."]}),`
`,u.jsxs(n.p,{children:["On the frontend, I built the UI with ",u.jsx(n.strong,{children:"React"})," and ",u.jsx(n.strong,{children:"TypeScript"}),", using globe.gl to render filming locations on a 3D globe. The visualization layer was surprisingly straightforward compared to the scraping logic. Most of the complexity lived in the data pipeline, not the UI."]}),`
`,u.jsxs(n.p,{children:["Deployment was a learning curve. This was my first time deploying to ",u.jsx(n.strong,{children:"AWS Lightsail"}),", and I chose to containerize everything using ",u.jsx(n.strong,{children:"Docker"})," and ",u.jsx(n.strong,{children:"Docker Compose"}),". I split the services into separate containers (app + database), added ",u.jsx(n.strong,{children:"Nginx"})," as a reverse proxy, and configured SSL with ",u.jsx(n.strong,{children:"Certbot"}),"."]}),`
`,u.jsx(n.p,{children:"However, I ran into portability issues. I developed on Windows, and some naming conventions and filesystem assumptions didnt translate cleanly to Linux. I had to refactor paths and container configurations to make everything Linux-compatible."}),`
`,u.jsx(n.p,{children:"Two weeks after deployment, the site went down. After hours of debugging, I discovered the Linux server disk was full. Docker had accumulated multiple images and container layers because the scraper was running every 6 hours. The fix was embarrassingly simple: clear unused Docker images and reduce the scraping frequency to once a week. It was a painful but valuable lesson in infrastructure awareness."}),`
`,u.jsx(n.hr,{}),`
`,u.jsx(n.h2,{children:"What I Learned"}),`
`,u.jsxs(n.ul,{children:[`
`,u.jsxs(n.li,{children:[`
