`,u.jsx(n.h2,{children:"Introduction"}),`
`,u.jsx(n.p,{children:"I Want To RAGE was built during NUS Hack&Roll 2026 as a last-minute idea that somehow became our main project. The concept was simple: what if you could safely destroy your Google widgets when youre stressed - without actually breaking anything?"}),`
`,u.jsx(n.p,{children:"The inspiration came from stickman destruction animations on YouTube. I wanted to recreate that chaotic, over-the-top energy, but inside the browser. Instead of animating characters, I thought: why not let users tear apart the very UI elements they interact with daily ?"}),`
`,u.jsx(n.p,{children:"The result is a Chrome web extension that converts Google widgets into destructible objects. Users can toggle a flamethrower mode, click to slice widgets in half, and physically throw them around the screen - all built using vanilla web technologies."}),`
`,u.jsx(n.hr,{}),`
`,u.jsx(n.h2,{children:"Intuition"}),`
`,u.jsxs(n.ul,{children:[`
`,u.jsxs(n.li,{children:[`
`,u.jsx(n.p,{children:"Browser extensions require careful DOM manipulation without breaking page functionality."}),`
