`,u.jsxs(n.li,{children:[`
`,u.jsx(n.p,{children:"Widgets need to be extracted from the DOM while preserving visual fidelity."}),`
`]}),`
`,u.jsxs(n.li,{children:[`
`,u.jsx(n.p,{children:"Destruction mechanics require physics simulation and object state management."}),`
`]}),`
`,u.jsxs(n.li,{children:[`
`,u.jsx(n.p,{children:"Performance must remain stable despite rapid user input."}),`
`]}),`
`,u.jsxs(n.li,{children:[`
`,u.jsx(n.p,{children:"Some sites intentionally obscure class names to prevent scraping or manipulation."}),`
`]}),`
`,u.jsxs(n.li,{children:[`
`,u.jsx(n.p,{children:"Rendering destruction effects needs to avoid excessive DOM reflows."}),`
`]}),`
`]}),`
`,u.jsx(n.hr,{}),`
`,u.jsx(n.h2,{children:"Process"}),`
`,u.jsx(n.p,{children:"This project was built entirely with vanilla JavaScript, HTML, and CSS. No frameworks - just raw browser APIs. The hardest problem early on was figuring out how to make existing widgets destructible. Removing them directly from the DOM broke layout and caused visual glitches. I needed a way to visually detach them without breaking the page itself."}),`
`,u.jsx(n.p,{children:"The breakthrough was using HTML Canvas. Instead of manipulating the live DOM nodes directly, I used html2canvas to render widgets into bitmap images. Once converted into canvas-rendered objects, I could treat them like independent entities - positioned absolutely and animated freely. This created the illusion that the widgets were being taken off the shelves.."}),`
`,u.jsx(n.p,{children:"Targeting widgets was tricky. Some sites randomize class names or rely heavily on nested div structures to guard against scraping or bot manipulation. Relying purely on class selectors was unreliable. I had to build more resilient DOM traversal logic based on structure and hierarchy instead of fixed identifiers."}),`
`,u.jsx(n.p,{children:"For physics simulation, I integrated a lightweight library to create a playground-like environment where widgets could be thrown around realistically. Clicking a widget slices it in half - which required re-rendering the two split sections separately using html2canvas again. Each half becomes its own physics object."}),`
`,u.jsx(n.p,{children:"The flamethrower mode was an extra layer of state logic. Pressing F toggles between cursor and flamethrower. When active, holding click applies damage over time. Widgets are assigned health values, and their colors darken progressively before splitting apart once health reaches zero. Managing these state transitions without freezing the browser required careful throttling of event listeners."}),`
`,u.jsx(n.p,{children:"Performance is hardware-dependent. Rapid clicking can spawn too many canvas redraws and physics updates, which can degrade performance. While reloads typically resolve minor issues, its clear the rendering pipeline could be optimized further."}),`
`,u.jsx(n.hr,{}),`
`,u.jsx(n.h2,{children:"What I Learned"}),`
`,u.jsxs(n.ul,{children:[`
`,u.jsxs(n.li,{children:[`
